import Signup from "./Component/Signup";
import "./App.css";
import { Route, Routes } from "react-router-dom";
import Login from "./Component/Merchant_login";

function App() {
  return (
    <div className="App">
      <Signup />
      {/* <Merchant_login/> */}

      <Routes>
        <Route path="/" element={<Signup />} />
        <Route path="/Login" element={<Login />} />
      </Routes>
    </div>
  );
}

export default App;
